\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThey just seem delighted by the flawed people around them. They just recognize what needs doing and they do it. They make you feel funnier and smarter when you speak with them. They move through different social classes not even aware, it seems, that they are doing so. After you’ve known them for a while it occurs to you that you’ve never heard them boast, you’ve never seen them self-righteous or doggedly certain.\n\nSeptember 8, 2015\n\u001c14\n\u0011\n\u0011\n\n\nChapter 1: The Shift\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTruly humble people are engaged in a great effort to magnify what is best in themselves and defeat what is worst, to become strong in the weak places. They start with an acute awareness of the bugs in their own nature. Our basic problem is that we are self-centered, a plight beautifully captured in the famous commencement address David Foster Wallace gave at Kenyon College in 2005: Everything in my own immediate experience supports my deep belief that I am the absolute center of the\n\nSeptember 11, 2015\n\u001c23\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cuniverse; the realest, most vivid and important person in existence. We rarely think about this sort of natural, basic self-centeredness because it’s so socially repulsive. But it’s pretty much the same for all of us. It is our default setting, hard-wired into our boards at birth. Think about it: there is no experience you have had that you are not the absolute center of. The world as you experience it is there in front of YOU or behind YOU, to the left or right of YOU, on YOUR TV or YOUR monitor. And so on. Other people’s thoughts and feelings have to be communicated to you somehow, but your own are so immediate, urgent, real. This self-centeredness leads in several unfortunate directions. It leads to selfishness, the desire to use other people as means to get things for yourself. I\n\nSeptember 11, 2015\n\u001c24\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou can see evidence of the inner struggle in such people’s journals. They are exultant on days when they win some small victory over selfishness and hard-heartedness. They are despondent on days when they let themselves down, when they avoid some charitable task because they were lazy or tired, or fail to attend to a person who wanted to be heard. They are more likely see their life as a moral adventure story. As the British writer Henry Fairlie put it, “If we acknowledge that our inclination to sin is part of our natures, and that we will never wholly eradicate it, there is at least something for us to do in our lives that will not in the end seem just futile and absurd.”\n\nSeptember 11, 2015\n\u001c25\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmoments in bed at night reviewing the mistakes of his day. His central sin, from which many of his other sins branch out, is a certain hardness of heart. He’s a busy guy with many people making demands on his time. Sometimes he is not fully present for people who are asking his advice or revealing some vulnerability. Sometimes he is more interested in making a good impression than in listening to other people in depth. Maybe he spent more time at a meeting thinking about how he might seem impressive than about what others were actually saying. Maybe he flattered people too unctuously. Each night, he catalogs the errors. He tallies his recurring core sins and the other mistakes that might have branched off from them. Then he develops strategies for how he might do better tomorrow. Tomorrow he’ll try to look differently at people, pause more before people. He’ll put care above prestige, the higher thing above the lower thing.\n\nSeptember 11, 2015\n\u001c25\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001che will struggle to inch ahead each day in this most important sphere\n\nSeptember 11, 2015\n\u001c26\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPeople who live this way believe that character is not innate or automatic. You have to build it with effort and artistry. You can’t be the good person you want to be unless you wage this campaign. You won’t even achieve enduring external success unless you build a solid moral core. If you don’t have some inner integrity, eventually your Watergate, your scandal, your betrayal, will happen. Adam I ultimately depends upon Adam II.\n\nSeptember 11, 2015\n\u001c26\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1rPhGhANkBLfTLXvumwvHJz1LWtGWWc7msGlIXsA","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1mq9N46wsBpvzFRzQTTZuhTticUIXZm3O1ESUAvs","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},