fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":3941,"ei":3960,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":3961,"ei":3978,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3979,"ei":4412,"sm":{"ts_ff_i":false,"ts_it":true,"ts_va":"nor","ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4413,"ei":4432,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4433,"ei":4438,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunk = [{"ty":"is","ibi":4439,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMoreover, the struggle against the weaknesses in yourself is never a solitary struggle. No person can achieve self-mastery on his or her own. Individual will, reason, compassion, and character are not strong enough to consistently defeat selfishness, pride, greed, and self-deception. Everybody needs redemptive assistance from outside—from family, friends, ancestors, rules, traditions, institutions, exemplars, and, for believers, God. We all need people to tell us when we are wrong, to advise us on how to do right,\n\nSeptember 11, 2015\n\u001c27\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cand to encourage, support, arouse, cooperate, and inspire us along the way. There’s something democratic about life viewed in this way. It doesn’t matter if you work on Wall Street or at a charity distributing medicine to the poor. It doesn’t matter if you are at the top of the income scale or at the bottom. There are heroes and schmucks in all worlds. The most important thing is whether you are willing to engage in moral struggle against yourself. The most important thing is whether you are willing to engage this struggle well—joyfully and compassionately. Fairlie writes, “At least if we recognize that we sin, know that we are individually at war, we may go to war as warriors do, with something of valor and zest and even mirth.” 13 Adam I achieves success by winning victories over others. But Adam II builds character by winning victories over the weaknesses in himself.\n\nSeptember 11, 2015\n\u001c27\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOnly the one who descends into the underworld rescues the beloved.”\n\nSeptember 11, 2015\n\u001c28\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSelf-respect is not the same as self-confidence or self-esteem. Self-respect is not based on IQ or any of the mental or physical gifts that help get you into a competitive college. It is not comparative. It is not earned by being better than other people at something. It is earned by being better than you used to be, by being dependable in times of testing, straight in times of temptation. It emerges in one who is morally dependable.\n\nSeptember 11, 2015\n\u001c28\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt can only be earned by a person who has endured some internal temptation, who has confronted their own weaknesses and who knows, “Well, if worse comes to worst, I can endure that. I can overcome that.\n\nSeptember 11, 2015\n\u001c29\n\u0011\n\u0011\n\n\nChapter 2: The Summoned Self\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSeptember 11, 2015\n\u001c36\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis is the way people tend to organize their lives in our age of individual autonomy. It’s a method that begins with the self and ends with the self, that begins with self-investigation and ends in self-fulfillment\n\nSeptember 11, 2015\n\u001c37\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat does life want from me? What are my circumstances calling me to do?\n\nSeptember 11, 2015\n\u001c37\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis perspective begins with an awareness that the world existed long before you and will last long after you, and that in the brief span of your life you have been thrown by fate, by history, by chance, by evolution, or by God into a specific place with specific problems and needs. Your job is to figure certain things out: What does this environment need in order to be made\n\nSeptember 11, 2015\n\u001c37\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwhole? What is it that needs repair? What tasks are lying around waiting to be performed? As the novelist Frederick Buechner put it, “At what points do my talents and deep gladness meet the world’s deep need?”\n\nSeptember 11, 2015\n\u001c37\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001call of us are given gifts, aptitudes, capacities, talents, and traits that we did not strictly earn. And all of us are put in circumstances that call out for action, whether they involve poverty,\n\nSeptember 11, 2015\n\u001c40\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThese circumstances give us the great chance to justify our gifts. Your ability to discern your vocation depends on the condition of your eyes and ears, whether they are sensitive enough to understand the assignment your context is giving you. As the Jewish Mishnah puts it, “It’s not your obligation to complete the work, but neither are you free to desist from beginning it.\n\nDo an activity that helps us understand out talents, gifts. Then another one to recognize the circumstances and contexts that demand our action. Then match..and the work begins.\n\nOctober 7, 2015\n\u001c40\n\u0011\n\u0011"},{"ty":"te","id":"i.10","spi":5929},{"ty":"te","id":"i.11","spi":6036},{"ty":"te","id":"i.12","spi":6513},{"ty":"te","id":"i.13","spi":6786},{"ty":"te","id":"i.14","spi":6824},{"ty":"te","id":"i.15","spi":7079},{"ty":"te","id":"i.16","spi":7191},{"ty":"te","id":"i.17","spi":7608},{"ty":"te","id":"i.18","spi":7857},{"ty":"te","id":"i.19","spi":8092},{"ty":"te","id":"i.8","spi":4448},{"ty":"te","id":"i.9","spi":5007},{"ty":"as","st":"paragraph","si":4439,"ei":4439,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4440,"ei":4440,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":4441,"ei":4441,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":4443,"ei":4443,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":4445,"ei":4445,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":4447,"ei":4447,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":fa