se,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8473,"ei":8651,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#424242","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":8652,"ei":8668,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunk = [{"ty":"is","ibi":8675,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOctober 7, 2015\n\u001c41\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThey feel the joy of having their values in deep harmony with their behavior. They experience a wonderful certainty of action that banishes weariness from even the hardest days.\n\nSeptember 11, 2015\n\u001c42\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDieman, diagnosed Perkins’s laziness, her tendency to be too easy on herself. Van Dieman used Latin grammar the way a drill instructor might use forced marches, as an ordeal to cultivate industriousness. She forced Perkins to work, hour upon hour, on precise recitations of the Latin verb tenses. Perkins would burst into tears in frustration and boredom, but later expressed appreciation for the enforced discipline: “For the first time I became conscious of character.”\n\nSeptember 11, 2015\n\u001c45\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cand she floundered badly in chemistry. Nonetheless, her chemistry teacher, Nellie Goldthwaite, hounded her into majoring in chemistry. The idea was that if she was tough enough to major in her weakest subject, she’d be tough enough to handle whatever life threw at her. Goldthwaite urged Perkins to take the hardest courses even if it meant earning mediocre grades. Perkins took the challenge. Goldthwaite became her faculty\n\nSeptember 11, 2015\n\u001c45\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cadviser. Years later, Perkins told a student with the school’s alumnae quarterly, “The undergraduate mind should concentrate on the scientific courses, which temper the human spirit, harden and refine it, and make of it a tool with which one may tackle any kind of material.” 22\n\nSeptember 11, 2015\n\u001c45\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbroader role of college: helping teenagers become adults. It inculcated self-control. It helped its students discover new things to love. It took young women and ignited their moral passions by giving them a sense that humans are caught in a web of good and evil and that life is an epic struggle between these large forces.\n\nSeptember 11, 2015\n\u001c46\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt emphasized that performing service is not something you do out of the goodness of your heart but as a debt you are repaying for the gift of life\n\nSeptember 11, 2015\n\u001c46\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDo what nobody else wants to do; go where nobody else wants to go,” the school’s founder, Mary Lyon, implored her students.\n\nSeptember 11, 2015\n\u001c46\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHull House was a settlement house cofounded by Jane Addams, the leading American social reformer of her day. The idea was to give women a new range of service careers, to link the affluent with the poor, and to re-create the sense of community that had been destroyed by the disruptions of industrialization. It was modeled after Toynbee Hall in London, in which affluent university men organized social gatherings with the poor in the same manner in which they would organize them with one another.\n\nSeptember 11, 2015\n\u001c48\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cUnited Nations, Samantha Power, perceptively observes that some people put themselves “at stake” when they get involved in a cause. That is to say, they feel that their own reputation and their own identity are at stake when decisions are made. They are active in the cause in part because of what it says about them, and they want their emotions and their identity and their pride to be validated along the way. Perkins was not “at stake” after the fire. She went to work in Albany, lobbying the state legislature for worker safety legislation. She left behind the prejudices of her upscale New York social set. She left behind the gentility of progressive politics. She would compromise ruthlessly if it meant making progress. Her mentor, Al Smith, a rising figure in New York politics, told Perkins that before long, the genteel progressives would lose interest in any cause. If you want to usher real change, he told her, you have to work with the sleazy legislators and the rough party pols\n\nSeptember 11, 2015\n\u001c51\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMother Perkins” for the way she led sixty-something state legislators. She despised the nickname, but she found that the method worked. She suppressed her sexuality, her femininity, and even part of her identity in order to win the confidence of the old men around her.\n\nSeptember 11, 2015\n\u001c53\n\u0011\n\u0011"},{"ty":"te","id":"i.20","spi":8684},{"ty":"te","id":"i.21","spi":8719},{"ty":"te","id":"i.22","spi":8936},{"ty":"t