:false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":12482,"ei":12501,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":12520,"ei":12790,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":12791,"ei":12810,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunk = [{"ty":"is","ibi":12817,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOvershadowing all Roosevelt’s decisions, Perkins wrote, “was his feeling that nothing in human judgment is final. One may courageously take the step that seems right today because it can be modified tomorrow if it does not work well.”\n\nSeptember 12, 2015\n\u001c61\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cShe also reflected on a distinction that had once seemed unimportant to her. When a person gives a poor man shoes, does he do it for the poor man or for God? He should do it for God, she decided. The poor will often be ungrateful, and you will lose heart if you rely on immediate emotional rewards for your work. But if you do it for God, you will never grow discouraged. A person with a deep vocation is not dependent on constant positive reinforcement. The job doesn’t have to pay off every month, or every year. The person thus called is performing a task\n\nSeptember 12, 2015\n\u001c64\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbecause it is intrinsically good, not for what it produces.\n\nSeptember 12, 2015\n\u001c64\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut it would also be hard to foresee how much she would accomplish throughout the hardship. She faced her own weaknesses—laziness, glibness—early in life and steeled herself for a life of total commitment. She suppressed her own identity so she could lobby for her cause.\n\nSeptember 12, 2015\n\u001c66\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNothing that is worth doing can be achieved in our lifetime; therefore we must be saved by hope\n\nSeptember 12, 2015\n\u001c67\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNothing we do, however virtuous, can be accomplished alone; therefore we are saved by love. No virtuous act is quite as virtuous from the standpoint of our friend or foe as it is from our standpoint. Therefore we must be saved by the final form of love, which is forgiveness\n\nSeptember 12, 2015\n\u001c67\n\u0011\n\u0011\n\n\nChapter 3: Self-Conquest\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe that conquereth his own soul is greater than he who taketh a city.” As she began to salve and bandage his wounds, she told her son to beware the anger and hatred burning inside. Hatred is a futile thing, she told him, which only injures the person who harbors it. Of all her boys, she told him, he had the most to learn about controlling his passions. When he was seventy-six, Eisenhower wrote, “I have always looked back on that conversation as one of the most valuable moments of my life. To my youthful mind, it seemed to me that she talked for hours, but I suppose the affair was ended in fifteen or\n\nSeptember 12, 2015\n\u001c73\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ctwenty minutes. At least she got me to acknowledge that I was wrong and I felt enough ease in my mind to fall off to sleep.” 8\n\nSeptember 12, 2015\n\u001c73\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSin is a necessary piece of our mental furniture because it reminds us that life is a moral affair. No matter how hard we try to reduce everything to deterministic brain chemistry, no matter how hard we try to reduce behavior to the sort of herd instinct that is captured in big data, no matter how hard we strive to replace sin with nonmoral words, like “mistake” or “error” or “weakness,” the most essential parts of life are matters of individual responsibility and moral choice: whether to be brave or cowardly, honest or deceitful, compassionate or callous, faithful or disloyal.\n\nSeptember 12, 2015\n\u001c74\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSeptember 12, 2015\n\u001c75\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo be aware of sin is to feel intense sympathy toward others who sin. It is to be reminded that as the plight of sin is communal, so the solutions are communal. We fight sin together, as communities and families, fighting our own individual sins by helping others fight theirs\n\nSeptember 12, 2015\n\u001c75\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe want to do one thing, but we end up doing another. We want what we should not want. None of us wants to be hard-hearted, but sometimes we are. No one wants to self-deceive, but we rationalize all the time. No one wants to be cruel, but we all blurt things out and regret them later. No one wants to be a bystander, to commit sins of omission, but, in the words of the poet Marguerite Wilkinson, we all commit the sin of “unattempted loveliness.\n\nSeptember 12, 2015\n\u001c75\n\u0011\n\u0011"},{"ty":"te","id":"i.31","spi"