oadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunk = [{"ty":"is","ibi":16852,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe danger of sin, in other words, is that it feeds on itself. Small moral compromises on Monday make you more likely to commit other, bigger moral compromises on Tuesday. A person lies to himself and soon can no longer distinguish when he is lying to himself and when he isn’t. Another person is consumed by the sin of self-pity, a passion to be a righteous victim that devours everything around it as surely as anger or greed. People rarely commit the big sins out of the blue. They walk through a series of doors. They have an unchecked problem with anger. They have an unchecked problem with drinking\n\nSeptember 12, 2015\n\u001c76\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn places like Abilene, Kansas, the big sins, left unchallenged, would have had very practical and disastrous effects. Sloth could lead to a failure of a farm; gluttony and inebriation to the destruction of a\n\nSeptember 12, 2015\n\u001c77\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cfamily; lust to the ruination of a young woman; vanity to excessive spending, debt, and bankruptcy\n\nSeptember 12, 2015\n\u001c77\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSeptember 12, 2015\n\u001c77\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cChange your behavior and eventually you rewire your brain.\n\nSeptember 12, 2015\n\u001c79\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIda emphasized the importance of practicing small acts of self-control: following the rules of etiquette when sitting at the table, dressing in one’s Sunday best when going to church, keeping the Sabbath afterward, using formal diction in letter writing as a display of deference and respect, eating plain food, avoiding luxury. If you are in the army, keep your uniform neat and your shoes polished. If you are at home, keep everything tidy. Practice the small outward disciplines.\n\nSeptember 12, 2015\n\u001c79\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYour reason and your will are simply too weak to defeat your desires all the time. Individuals are strong, but they are not self-sufficient. To defeat sin you need help from outside. Her character-building method had a tender side as well. Fortunately, love is the law of our nature. People like Ida understand that love, too, is a tool to build character. The tender character-building strategy is based on the idea that we can’t always resist our desires, but we can change and reorder our desires by focusing on our higher loves. Focus on your love for your children. Focus on your love of country. Focus on your love for the poor and downtrodden\n\nSeptember 12, 2015\n\u001c80\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI did my best to meet everyone from general to private with a smile, a pat on the back and a definite interest in his problems. 17 He devised stratagems for dismissing his true passions. For example, in his diaries he made lists of people who offended him as a way of sealing off his anger toward them. When he felt a surge of hatred, he refused to let it rule him. “Anger cannot win. It cannot even think clearly,” he noted in his diary\n\nSeptember 12, 2015\n\u001c83\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAlways try to associate yourself closely and learn as much as you can from those who know more than you, who do better than you, who see more clearly than you.” He was a fanatic about both preparation a\n\nSeptember 12, 2015\n\u001c85\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe plans are nothing, but the planning is everything,” he would say. Or, “Rely on planning, but never trust plans.” He also gained a perspective on himself. He began carrying around an anonymous little poem: Take a bucket, fill it with water, Put your hand in—clear up to the wrist. Now pull it out; the hole that remains Is a measure of how much you’ll be missed…. The moral of this quaint example: To do just the best that you can, Be proud of yourself, but remember, There is no Indispensible Man! 24\n\nSeptember 12, 2015\n\u001c85\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIke was particularly affected by the training of a horse, “Blackie.” In his memoirs, he wrote: In my experience with Blackie—and earlier with allegedly incompetent recruits at Camp Colt—is rooted my enduring conviction that far too often we write off a backward child as hopeless, a clumsy animal as worthless, a worn-out field as beyond restoration. This we do largely out of our own lack of willingness to take the time and spend the effort to prove ourselves wrong: to prove that a difficult boy can become a fine man, that an animal can respond to training, that the field can regain its fertility. 28\n\nSeptember 12, 2015\n\u001c86\n\u0011\n\u0011"},{"ty":"te","id":"i.43","spi":16861},{"ty":"te","id":"i.44","spi":17505},{"ty":"te","id":"i.45","spi":17753},{"ty":"te","id":"i.46","spi":17891},{"ty":"te","id":"i.47","spi":17929},{"ty":"te","id":"i.48","spi":18027},{"ty":"te","id":"i.49","spi":18549},{"ty":"te","id":"i.50","spi":19238},{"ty":"te","id":"i.51","spi":19715},{"ty":"te","id":"i.52","spi":19957},{"ty":"te","id":"i.53","spi":20501},{"ty":"as","st":"paragraph","si":16852,"ei":16852,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":16853,"ei":168