oid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":21111,"ei":21130,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunk = [{"ty":"is","ibi":21137,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe saw it as another hard duty to be endured. He had learned to focus less on the glamor and excitement of wartime heroics and more on the dull, mundane things that would prove to be the keys to victory. Preserving alliances with people you might find insufferable. Building enough landing craft to make amphibious invasions possible. Logistics.\n\nSeptember 12, 2015\n\u001c88\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe true self is what you have built from your nature, not just what your nature started out with.\n\nSeptember 12, 2015\n\u001c90\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOn the contrary, moderation is based on an awareness of the inevitability of conflict. If you think that the world can fit neatly together, then you don’t need to be moderate. If you think all your personal qualities can be brought together into simple harmony, you don’t need to hold back, you can just go whole hog for self-actualization and growth. If you think all moral values point in the same direction, or all political goals can be realized all at once by a straightforward march along one course, you don’t need to be moderate, either. You can just head in the direction of truth as quickly as possible. Moderation is based on the idea that things do not fit neatly together. Politics is likely to be a competition between legitimate opposing interests. Philosophy is likely to be a tension between competing half-truths. A personality is likely to be a battleground of valuable but incompatible traits.\n\nSeptember 12, 2015\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe aims to be passionate about his ends but deliberate about the proper means to realize them. The best moderate is blessed with a spirited soul and also the proper character to tame it.\n\nSeptember 12, 2015\n\u001c95\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe distrusts passionate intensity and bold simplicity because he know that in politics the lows are lower than the highs are high—the damage leaders do when they get things wrong is greater than the benefits they create when they get things right. Therefore caution is the proper attitude, an awareness of the limits the foundation of wisdom.\n\nSeptember 12, 2015\n\u001c95\n\u0011\n\u0011\n\n\nChapter 4: Struggle\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“A whole life is prefigured in that episode”—the crisis, the sense of God’s nearness, the awareness of poverty, the feeling of loneliness and abandonment, but also the sense that that loneliness can be filled by love and community, especially through solidarity with those in deepest need. 4\n\nSeptember 13, 2015\n\u001c98\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAt age eighteen, after a couple of years at Illinois, she decided that college life was unsatisfying. She moved to New York to become a writer. She wandered the city for months, desperately lonely: “In all that great city of seven millions, I found no friends; I had no work, I was separated from my fellows. Silence in the midst of city noises oppressed me. My own silence, the feeling that I had no one to talk to overwhelmed me so that my very throat was constricted; my heart was heavy with unuttered\n\nSeptember 13, 2015\n\u001c102\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“I liked the order of life and the discipline. By contrast the life that I had been leading seemed disorderly and futile,” she recalled. “One of the things that this year in the hospital made me realize is that one of the hardest things in the world is to organize ourselves and discipline ourselves.” 12\n\nSeptember 13, 2015\n\u001c104\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cshe was unfit for the life of politics, with its compromises, self-seeking, shades of gray, and dirty hands.\n\nSeptember 13, 2015\n\u001c107\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSeptember 13, 2015\n\u001c114\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSeptember 13, 2015\n\u001c115\n\u0011\n\u0011\n\n\nChapter 7: Love\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn her famous preface to Middlemarch , Eliot writes about the crisis of vocation that many young women feel. They experience a great yearning inside, she wrote, a spiritual ardor to devote their energies in some substantial, heroic, and meaningful\n\nSeptember 13, 2015\n\u001c189\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdirection. They are propelled by moral imagination, the urge to do something epic and righteous with their life. These young women, “fed from within,” soared after some “illimitable satisfaction, some object which would never justify weariness, which would reconcile self-despair with the rapturous consciousness of life beyond self.”\n\nSeptember 13, 2015\n\u001c189\n\u0011\n\u0011"},{"ty":"te","id":"i.54","spi":21146},{"ty":"te","id":"i.55","spi":21531},{"ty":"te","id":"i.56","spi":21669},{"ty":"te","id":"i.57","spi":22622},{"ty":"te","id":"i.58","spi":2284