; DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunk = [{"ty":"is","ibi":25372,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI shall always reign through the intellect, but the life! The life! O my god! Shall that never be sweet?\n\nSeptember 13, 2015\n\u001c203\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLove depends on the willingness of each person to be vulnerable and it deepens that vulnerability. It works because each person exposes their nakedness and the other rushes to meet it. “You will be loved the day when you will be able to show your weakness without the person using it to assert his strength,” the Italian novelist Cesar Pavese wrote.\n\nSeptember 14, 2015\n\u001c208\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis has made them more frightened, and more open to damage, but also kinder, more capable of living life as an offering.\n\nSeptember 15, 2015\n\u001c212\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe person or thing they once loved hotly they now love warmly but steadily, happily, unshakably. They don’t even think of loving their beloved because they want something back. They just naturally offer love as a matter of course. It is gift-love, not reciprocity-love\n\nSeptember 15, 2015\n\u001c213\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe celebrated her superior talent. He encouraged, elicited, and nurtured it. With a thousand letters and gestures, he put himself second and her uppermost in his mind.\n\nSeptember 15, 2015\n\u001c213\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwhen the day is done, and the lights are out, and there is only this other heart, this other mind, this other face, to assist in repelling one’s demons or in greeting one’s angels, it does not matter who the president is. When one consents to marry, one consents to be truly known, which is an ominous prospect; and so one bets on love to correct for the ordinariness of the impression, and to call forth the forgiveness that is invariably required by an accurate perception of oneself. Marriages are exposures. We may be heroes to our spouses but we may not be idols.\n\nSeptember 15, 2015\n\u001c214\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat greater thing is there for two human souls,” Eliot would later write in Adam Bede , “than to feel they are joined for life—to strengthen each other in all labor, to rest on each other in all sorrow, to minister to each other in all pain, to be one with each other in silent unspeakable memories at the moment of last parting.\n\nSeptember 15, 2015\n\u001c216\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLewes had long encouraged Eliot to write fiction. He wasn’t sure she could come up with plots, but he knew she had a genius for description and characterization. Plus, fiction paid better than nonfiction, and the Lewes family was always hard up for cash. He urged her to just try her hand: “You must try to write a story.” One morning in September 1856, she was fantasizing about writing fiction when a title popped into her head: The Sad Fortunes of the Reverend Amos Barton . Lewes was immediately enthusiastic. “Oh what a capital title!” he blurted. A week later she read to him the first part of what she had written. He knew immediately that Eliot was a gifted writer.\n\nSeptember 15, 2015\n\u001c217\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe books had to be pushed out of her like children, painfully and amid exhaustion. Like most people who write, she had to endure the basic imbalance of the enterprise. The writer shares that which is intimate and vulnerable, but the reader is far away, so all that comes back is silence\n\nSeptember 15, 2015\n\u001c220\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEliot herself believed that the beginning of wisdom was the faithful and attentive study of present reality, a thing itself, a person herself, unfiltered by abstract ideas, mists of feeling, leaps of imagination, or religious withdrawals into another realm.\n\nSeptember 15, 2015\n\u001c221\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthe growing good of the world is partly\n\nSeptember 15, 2015\n\u001c221\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdependent on unhistoric acts\n\nSeptember 15, 2015\n\u001c221\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMany of her characters, and especially her magnetic character, Dorothea Brooke in Middlemarch , begin their adulthood with an ardent moral ambition. They want to achieve some great good, like a Saint Teresa, but they don’t know what it is or what their vocation might be or just how to go about it. Their attention is fixed on some pure ideal, some distant horizon. Eliot was a Victorian; she believed in moral improvement. But she used her novels to critique such lofty and otherworldly moral goals. They are too abstract, and they can easily, as in Dorothea’s case, be unrealistic and delusional. The best moral reform, she counters, is tied to the here and now, directed by honest feelings for this or that individual rather than for humanity as a whole\n\nSeptember 15, 2015\n\u001c223\n\u0011\n\u0011"},{"ty":"te","id":"i.67","spi":25381},{"ty":"te","id":"i.68","spi":25526},{"ty":"te","id":"i.69","spi":25916},{"ty":"te","id":"i.70","spi":26078},{"ty":"te","id":"i.71","spi":26388},{"ty":"te","id":"i.72","spi":26596},{"ty":"te","id":"i.73","spi":27205},{"ty":"te","id":"i.74","spi":27576},{"ty":"te","id":"i.75","spi":28290},{"ty":"te",