rif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":28960,"ei":28979,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":28999,"ei":29028,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":29029,"ei":29048,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":29068,"ei":29825,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":29826,"ei":29845,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunk = [{"ty":"is","ibi":29853,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThere are limits, she teaches, in how much we can change other people or how quickly we can change ourselves. So much of life is lived in a state of tolerance—tolerating other people’s weaknesses and our own sins, even as we try to have some slow, loving effect. “These fellow mortals, every one,” she wrote in Adam Bede , “must be accepted as they are: you can neither straighten their noses nor brighten their wit nor rectify their dispositions; and it is these people—amongst whom your life is passed—that it is needful you should tolerate, pity, and love:\n\nSeptember 15, 2015\n\u001c223\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cfor whom you should cherish all possible hopes, all possible patience\n\nSeptember 15, 2015\n\u001c224\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPeople glorify all sorts of bravery except the bravery they might show on behalf of their nearest neighbor,” she wrote—a mature sentiment if ever there was one\n\nSeptember 15, 2015\n\u001c224\n\u0011\n\u0011\n\n\nChapter 8: Ordered Love\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHis Adam II life was a mess. “I was tossed to and fro,” he writes in the Confessions , “I poured myself out, was made to flow away in all directions and boiled off\n\nSeptember 16, 2015\n\u001c232\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAt a phenomenally young age, he won the ultimate mark of success. He was given a chance to speak before the imperial court. He found that he was a mere peddler of empty words. He told lies and people loved him for it so long as the lies were well crafted. There was nothing in his life he could truly love, nothing that deserved the highest form of devotion: “I was famished within, deprived of inner food.” His hunger for admiration enslaved him rather than\n\nSeptember 16, 2015\n\u001c232\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u00
12\u001c*\n\u001cdelighting him. He was at the whim of other people’s facile opinions, sensitive to the slightest criticism, always looking for the next rung on the golden ladder. This frantic pursuit of the glittering vices killed tranquillity\n\nSeptember 16, 2015\n\u001c232\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccautious semicommitments without really surrendering to some larger purpose.\n\nSeptember 16, 2015\n\u001c233\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOctober 7, 2015\n\u001c233\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAugustine found himself feeling increasingly isolated. If you organize your life around your own wants, other people become objects for the satisfaction of your own desires. Everything is coldly instrumental. Just as a prostitute is rendered into an object for the satisfaction of orgasm, so a professional colleague is rendered into an object for the purpose of career networking, a stranger is rendered into an object for the sake of making a sale, a spouse is turned into an object for the purpose of providing you with love\n\nSeptember 16, 2015\n\u001c233\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA true lover delights to serve his beloved. But lust is all incoming. The person in lust has a void he needs filled by others. Because he is unwilling to actually serve others and build a full reciprocal relationship, he never fills the emotional emptiness inside. Lust begins with a void and ends with a void\n\nJune 13, 2017\n\u001c233\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe person chosen to be Augustine’s official wife was just ten years old, two years below the legal age of marriage, so Augustine took another concubine to satisfy his cravings in the interim. This is what he was doing in all phases of his life at this point: shedding sacrificial commitments in favor of status and success. One day, while walking in Milan, he observed a beggar who had clearly just finished a good meal and had a few drinks. The man was joking and joyful. Augustine realized that though he himself toiled and worked all day, fraught with anxieties, the beggar, who did none of these things, was happier than he was. Maybe he was suffering because he was shooting for higher goals, he considered. No, not really, he was seeking the same earthly pleasures as that beggar, but he was finding none of\n\nSeptember 16, 2015\n\u001c234\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthem. By his late twenties Augustine had become thoroughly alienated. Here he was living an arduous life and it was providing him with none of the nourishment he needed. He had desires that didn’t lead to happiness and yet he still followed his desires. What on earth was going on?\n\nSeptember 16, 2015\n\u001c234\n\u0011\n\u0011"},{"ty":"te","id":"i.80","spi":29862},{"ty":"te","id":"i.81","spi":30462},{"ty":"te","id":"i.82","spi":30572},{"ty":"te","id":"i.83","spi":30798},{"ty":"te","id":"i.84","spi":31002},{"ty":"te","id":"i.85","spi":31501},{"ty":"te","id":"i.86","spi":31769},{"ty":"te","id":"i.87","spi":31886},{"ty":"te","id":"i.88","spi":31922},{"ty":"te","id":"i.89","spi":32490},{"ty":"te","id":"i.90","spi":32835},{"ty":"te","id":"i.91","spi":33690},{"ty":"as","st":"paragraph","si":29853,"ei":29853,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":29854,"ei":29854,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":29855,"ei":29855,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":29857,"ei"