true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":33654,"ei":33673,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":33693,"ei":33975,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":33976,"ei":33995,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunk = [{"ty":"is","ibi":34003,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOctober 2, 2015\n\u001c234\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwrong things. Whether it’s around the dessert tray or in the late-night bar, we know we should choose one thing but end up choosing another. As the Bible says in Romans, “For the good that I would I do not: but the evil which I would not, that I do.” What sort of mysterious creature is a human being, Augustine mused, who can’t carry out his own will, who knows his long-term interest but pursues short-term pleasure, who does so much to screw up his own life? This led to the conclusion that people are a problem to themselves. We should regard ourselves with distrust: “I greatly fear my hidden parts,” 13 he wrote.\n\nSeptember 16, 2015\n\u001c235\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe story of the stealing of the pears is also the story of a rotten friendship. Augustine realizes he probably wouldn’t have done it if he had been alone. It was the desire for camaraderie, for mutual admiration, that egged the boys on into doing what they did. We so fear exclusion from the group that we are willing to do things that we would find unconscionable in other circumstances. When unattached to the right ends, communities can be more barbarous than individuals\n\nSeptember 16, 2015\n\u001c237\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAugustine began to reform his life. His first step was to quit the Manichees. It no longer seemed true to him that the world was neatly divided into forces of pure good and pure evil. Instead, each virtue comes with its own vice—self-confidence with pride, honesty with brutality, courage with recklessness, and so on\n\nSeptember 16, 2015\n\u001c238\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut eventually Augustine came to believe that you can’t gradually reform yourself. He concluded that you can’t really lead a good life by using old methods. That’s because the method is the problem. The crucial flaw in his old life was the belief that he could be the driver of his own journey. So long as you believe that you are the captain of your own life, you will be drifting farther and farther from the truth.\n\nSeptember 16, 2015\n\u001c239\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou can’t lead a good life by steering yourself, in the first place, because you do not have the capacity to do so. The mind is such a vast, unknown cosmos you can never even know yourself by yourself.\n\nSeptember 16, 2015\n\u001c240\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe powers of self-deception are so profound you are rarely fully honest with yourself.\n\nSeptember 16, 2015\n\u001c240\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn the Confessions , Augustine paints the scene when the delay finally ended. He was sitting in a garden talking with a friend, Alypius, who told him some stories about monks in Egypt who gave up everything to serve God. Augustine was amazed. The people who were not part of the elite educational system were out doing amazing things while the graduates of that system lived for themselves. “What ails us?” Augustine cried. “The unlearned start up and take heaven by force and we, with this our learning, but without heart, wallow in flesh and blood.”\n\nSeptember 17, 2015\n\u001c243\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGod wants to give us a gift, and we want to buy it.” 18 We continually want to earn salvation and meaning through work and achievement.\n\nSeptember 17, 2015\n\u001c246\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe lived, as we do today, in a thoroughly class-driven society, striving upward. But in Christianity, at least in its ideal form, the sublime is not in the prestigious and the lofty but in the everyday and the lowly. It is in the washing of feet, not in triumphal arches. Whoever exalts himself shall be humbled. Whoever humbles himself shall be exalted. One goes down in order to rise up. As Augustine put it, “Where there’s humility, there’s majesty; where there’s weakness, there’s might; where there’s death, there’s life. If you want to get these things, don’t disdain those.”\n\nSeptember 17, 2015\n\u001c247\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGod offers us grace, which is his unmerited love. God’s protection and care comes precisely because you do not deserve it and cannot earn it. Grace doesn’t come to you because you’\n\nSeptember 18, 2015\n\u001c248\n\u0011\n\u0011"},{"ty":"te","id":"i.100","spi":37001},{"