se,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":37180,"ei":37762,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":37763,"ei":37782,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":37802,"ei":37983,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":37984,"ei":38003,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunk = [{"ty":"is","ibi":38011,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne of the things you have to do in order to receive grace is to renounce the idea that you can earn it. You have to renounce the meritocratic impulse that you can win a victory for God and get rewarded for your effort. Then you have to open up to it. You do not know when grace will come to you. But people who are open and sensitive to it testify that they have felt grace at the oddest and at the most needed times.\n\nSeptember 18, 2015\n\u001c248\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGrace strikes us when we are in great pain and restlessness. It strikes us when we walk through the dark valley of a meaningless and empty life…. It strikes us when our disgust for our own being,\n\nSeptember 18, 2015\n\u001c249\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThose of us in mainstream culture are used to the idea that people get loved because they are kind, or funny, or attractive, or smart, or attentive. It’s surprisingly difficult to receive a love that feels unearned. But once you accept the fact that you are accepted, there is a great desire to go meet this love and reciprocate this gift.\n\nSeptember 18, 2015\n\u001c249\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThey take pleasure in tasks that might please him. They work tirelessly at tasks that they think might glorify him. The desire to rise up and meet God’s love can arouse mighty energies. And as people rise up and seek to meet God, their desires slowly change. In prayer, people gradually reform their desires so that more and more they want the things they believe will delight God rather than the things they used to think would delight themselves.\n\nSeptember 18, 2015\n\u001c250\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFor Augustine, that’s the crucial change. Knowledge is not enough for tranquillity and goodness, because it doesn’t contain the motivation to be good. Only love impels action. We don’t become better because we acquire new information. We become better because we acquire better loves. We don’t become what we know. Education is a process of love formation. When you go to a school, it should offer you new things to love.\n\nSeptember 18, 2015\n\u001c254\n\u0011\n\u0011\n\n\nChapter 9: Self-Examination\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen Johnson was nineteen, his mother came into a small legacy, which was enough to pay for a single year at Oxford. Johnson promptly made the least of the opportunity. He came to Oxford fully aware of his ability, burning with ambition, panting, as he would later put it, for a name and the “pleasing hope of endless fame.” But, accustomed to his independent autodidactic life and feeling financially and socially inferior to many of the students around him, he was incapable of playing by\n\nSeptember 18, 2015\n\u001c258\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe Germans have a word for this condition: Zerrissenheit —loosely, “falling-to-pieces-ness.” This is the loss of internal\n\nSeptember 18, 2015\n\u001c263\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccoherence that can come from living a multitasking, pulled-in-a-hundred-directions existence. This is what Kierkegaard called “the dizziness of freedom.” When the external constraints are loosened, when a person can do what he wants, when there are a thousand choices and distractions, then life can lose coherence and direction if there isn’t a strong internal structure.\n\nSeptember 18, 2015\n\u001c263\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccharacter is formed in community\n\nSeptember 18, 2015\n\u001c265\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe did not believe knowledge was best pursued as a solitary venture. He wrote, “Happiness is not found in self contemplation; it is perceived only when it is reflected from another.”\n\nSeptember 18, 2015\n\u001c268\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ctesting his observations against the reality of a world he could see concretely in front of him. “I look upon every day to be lost in which I do not make a new acquaintance,” he observed. He dreaded solitude. He was always the last one to leave the pub, preferring walking the streets throughout the night with his dissolute friend Richard Savage to going home to the loneliness of his haunted chambers. “The true state of every nation,” he observed, “is the state of common life. The manners of a people are not to be found in schools of learning or the palaces of greatness.” Johnson socialized with people at every level.\n\nSeptember 18, 2015\n\u001c268\n\u0011\n\u0011"},{"ty":"te","id":"i.103","spi":38020},{"ty":"te","id":"i.104","spi":38479},{"ty":"te","id":"i.105","spi":38715},{"ty":"te","id":"i.106","spi":39095},{"ty":"te","id":"i.107","spi":39584},{"ty":"te","id":"i.108","spi":40076},{"ty":"te","id":"i.109","spi":40607},{"ty":"te","id":"i.110","spi":40770},{"ty":"te","id":"i.111","spi":41183},{"ty":"te","id":"i.112","spi":41256},{"ty":"te","id":"i.113","spi":41479},{"ty":"as","st":"paragraph","si":38011,"ei":38011,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":38012,"ei":38012,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":38013,"ei":38013,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":38015,"ei":38015,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":38017,"ei":38017,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":38019,"ei":38019,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell_bt_i":false,"cell_bb":{},"cell_pl":0.0}},{"ty":"as","st":"paragraph","si":