"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":41259,"ei":41442,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":41443,"ei":41462,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":41482,"ei":42107,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":42108,"ei":42127,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunk = [{"ty":"is","ibi":42135,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHow small, of all that human hearts endure, / That part which laws and kings\n\nSeptember 18, 2015\n\u001c269\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccan cause or cure.”\n\nSeptember 18, 2015\n\u001c269\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe always focused with his searing eye on the particularity of each individual. Ralph Waldo Emerson would later observe that “Souls are not saved in bundles.” 16 Johnson fervently believed in each individual’s mysterious complexity and inherent dignity.\n\nSeptember 18, 2015\n\u001c269\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFor him, like other humanists of that age, the essential human act is the act of making strenuous moral decisions. He, like other humanists, believed that literature could be a serious force for moral improvement. Literature gives not only new information but new experiences. It can broaden the range of awareness and be an occasion for evaluation. Literature can also instruct through pleasure.\n\nSeptember 18, 2015\n\u001c269\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cToday many writers see literature and art only in aesthetic terms, but Johnson saw\n\nSeptember 18, 2015\n\u001c269\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthem as moral enterprises. He hoped to be counted among those writers who give “ardor to virtue and confidence to truth.” He added, “It is always a writer’s duty to make the world better.”\n\nSeptember 18, 2015\n\u001c270\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe reigning error of mankind is that we are not content with the conditions on which the goods of life are granted.\n\nSeptember 18, 2015\n\u001c270\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you are idle, be not solitary; if you are solitary, be not idle.\n\nSeptember 18, 2015\n\u001c271\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cVery few can boast of hearts which they dare lay open to themselves.\n\nSeptember 18, 2015\n\u001c271\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe world is so bursting with sin and sorrow that “there are none to be envied.” Everyone has some deep trouble in their lives. Almost no one truly enjoys their own achievements, since their desires are always leaping forward and torturing them with visions of goods unpossessed.\n\nSeptember 18, 2015\n\u001c272\n\u0011\n\u0011\n\n\nChapter 10: The Big Me\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe self is about talent, not character.\n\nOrganizing competencies by Adam I and adam ii\n\nSeptember 19, 2015\n\u001c301\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe meaning of the word “character” changes. It is used less to describe traits like selflessness, generosity, self-sacrifice, and other qualities that sometimes make worldly success less likely. It is instead used to describe traits like self-control, grit, resilience, and tenacity, qualities that make worldly success more likely.\n\nSeptember 19, 2015\n\u001c302\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csatisfice,” to get by on talent and just enough commitment to get the job done on time, without full soul commitment to any task.\n\nSeptember 19, 2015\n\u001c303\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis tradition tells you how to do the things that will propel you to the top, but it doesn’t encourage you to ask yourself why you are doing them. It offers little guidance on how to choose among different career paths and different vocations, how to determine which will be morally highest and best. It encourages people to become approval-seeking machines, to measure their lives by external praise—if people like you and accord you status, then you must be doing something right. The meritocracy contains its own cultural contradictions. It encourages people to make the most of their capacities, but it leads to the shriveling of the moral faculties that are necessary if you are going to figure out how to point your life in a meaningful direction.\n\nSeptember 19, 2015\n\u001c303\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe parental relationship is supposed to be built upon unconditional love—a gift that cannot be bought and cannot be earned. It sits outside the logic of meritocracy and is the closest humans come to grace. But in these cases the pressure to succeed in the Adam I world has infected a relationship that should be operating by a different logic, the moral logic of Adam II.\n\nSeptember 19, 2015\n\u001c306\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSeptember 19, 2015\n\u001c308\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cChristian Smith of Notre Dame studied the moral lives of American college students. He asked them to describe a moral dilemma they had recently faced. Two thirds of the young people either couldn’t describe a moral problem or described problems that are not moral at all. For example, one said\n\nSeptember 19, 2015\n\u001c308\n\u0011\n\u0011"},{"ty":"te","id":"i.114","spi":42144},{"ty":"te","id":"i.115","spi":42261},{"ty":"te","id":"i.116","spi":42321},{"ty":"te","id":"i.117","spi":42615},{"ty":"te","id":"i.118","spi":43052},{"ty":"te","id":"i.119","spi":43175},{"ty":"te","id":"i.120","spi":43404},{"ty":"te","id":"i.121","spi":43561},{"ty":"te","id":"i.122","spi":43669},{"ty":"te","id":"i.123","spi":43778},{"ty":"te","id":"i.124","spi":44123},{"ty":"te","id":"i.125","spi":44251},{"ty":"te","id":"i.126","spi":44625},{"ty":"te","id":"i.127","spi":44795},{"ty":"te","id":"i.128","spi":45590},{"ty":"te","id":"i.129","spi":46003},{"ty":"te","id":"i.130","spi":46042},{"ty":"as","st":"paragraph","si":42135,"ei":42135,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":42136,"ei":42136,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":42137,"ei":42137,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","s