s_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":46006,"ei":46025,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":46045,"ei":46339,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":46340,"ei":46359,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lnflj7nt+wC94fT6719hHXCqWXQ"  nonce="lnflj7nt+wC94fT6719hHXCqWXQ">DOCS_modelChunk = [{"ty":"is","ibi":46367,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001chis most recent moral dilemma arose when he pulled in to a parking space and didn’t have enough quarters for the meter. “Not many of them have previously given much or any thought to many of the kinds of questions about morality that we asked,” Smith and his coauthors wrote. They didn’t understand that a moral dilemma arises when two legitimate moral values clash. Their default position was that moral choices are just a question of what feels right inside, whether it arouses a comfortable emotion. One student uttered this typical response: “I mean, I guess what makes something right is how I feel about it. But different people feel different ways, so I couldn’t speak on behalf of anyone else as to what’s right and wrong.” 27\n\nSeptember 19, 2015\n\u001c308\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s probably necessary to build a moral ecology based on the ideas of this school, to follow its answers to the most important questions: Toward what should I orient my life? Who am I and what is my nature? How do I mold my nature to make it gradually better day by day? What virtues are the most important to cultivate and what weaknesses should I fear the most? How can I raise my children with a true sense of who they are and a practical set of ideas about how to travel the long road to character?\n\nSeptember 19, 2015\n\u001c312\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSeptember 19, 2015\n\u001c312\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdeep down, human beings are endowed with moral imagination. All human beings seek to lead lives not just of pleasure, but of purpose, righteousness, and virtue\n\nSeptember 19, 2015\n\u001c312\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSeptember 19, 2015\n\u001c312\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe meaningful life is the same eternal thing, the combination of some set of ideals and some man or woman’s struggle for those ideals.\n\nSeptember 19, 2015\n\u001c312\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe long road to character begins with an accurate understanding of our nature, and the core of that understanding is that we are flawed creatures. We have an innate tendency toward selfishness and overconfidence. We have a tendency to see ourselves as the center of the universe, as if everything revolves around us. We resolve to do one thing but end up doing the opposite. We know what is deep and important in life, but we still pursue the things that are shallow and vain. Furthermore, we overestimate our own strength and rationalize our own failures. We know less than we think we do. We give in to short-term desires even when we know we shouldn’t.\n\nSeptember 19, 2015\n\u001c313\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOctober 7, 2015\n\u001c313\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAlthough we are flawed creatures, we are also splendidly endowed. We are divided within ourselves, both fearfully and wonderfully made. We do sin, but we also have the capacity to recognize sin, to feel ashamed of sin, and to overcome sin. We are both weak and strong, bound and free, blind and far-seeing. We thus have the capacity to struggle with ourselves. There is something heroic about a person in struggle with herself, strained on the rack of conscience, suffering torments, yet staying alive and growing stronger, sacrificing a worldly success for the sake of an inner victory.\n\nSeptember 19, 2015\n\u001c313\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn the struggle against your own weakness, humility is the greatest virtue. Humility is having an accurate assessment of your own nature and your own place in the cosmos.\n\nSeptember 19, 2015\n\u001c313\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHumility is an awareness that your individual talents alone are inadequate to the tasks that have been assigned to you. Humility reminds you that you are not the center of the universe, but you serve a larger order.\n\nSeptember 19, 2015\n\u001c313\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPride makes us more certain and closed-minded than we should be. Pride makes it hard for us to be vulnerable before those whose love we need. Pride makes coldheartedness and cruelty possible. Because of pride we try to prove we are better than those around us.\n\nSeptember 19, 2015\n\u001c314\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNo external conflict is as consequential or as dramatic as the inner campaign against our own deficiencies.\n\nSeptember 19, 2015\n\u001c314\n\u0011\n\u0011"},{"ty":"te","id":"i.131","spi":46376},{"ty":"te","id":"i.132","spi":47151},{"ty":"te","id":"i.133","spi":47695},{"ty":"te","id":"i.134","spi":47734},{"ty":"te","id":"i.135","spi":47934},{"ty":"te","id":"i.136","spi":47973},{"ty":"te","id":"i.137","spi":48149},{"ty":"te","id":"i.138","spi":48846},{"ty":"te","id":"i.139","spi":48882},{"ty":"te","id":"i.140","spi":49510},{"ty":"te","id":"i.141","spi":49721},{"ty":"te","id":"i.142","spi":49977},{"ty":"te","id":"i.143","spi":50278},{"ty":"as","st":"paragraph","si":46367,"ei":46367,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":46368,"ei":46368,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":46369,"ei":46369,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":46371,"ei":46371,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":46373,"ei":46373,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":46375,"ei":46375,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell_bt_i":false,"cell_bb":{},"cell_pl":0.0}},{"ty":"as","st":"paragraph","si":46377,"ei":46377,"sm":{"ps_klt_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sm_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,