esires, and habits that are slowly engraved during the struggle against your own weakness. You become more disciplined, considerate, and loving through a thousand small acts of self-control, sharing, service, friendship, and refined enjoyment.\n\nSeptember 19, 2015\n\u001c314\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe things that lead us astray are short term—lust, fear, vanity, gluttony. The things we call character endure over the long term—courage, honesty, humility. People with character are capable of a long obedience in the same direction, of staying attached to people and causes and callings consistently through thick and thin. People with character also have scope. They are not infinitely flexible,\n\nSeptember 19, 2015\n\u001c315\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cfree-floating, and solitary. They are anchored by permanent attachments to important things. In the realm of the intellect, they have a set of permanent convictions about fundamental truths. In the realm of emotion, they are enmeshed in a web of unconditional loves. In the realm of action, they have a permanent commitment to tasks that cannot be completed in a single lifetime.\n\nSeptember 19, 2015\n\u001c315\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNo person can achieve self-mastery on his or her own.\n\nSeptember 19, 2015\n\u001c315\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSeptember 21, 2015\n\u001c316\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe wage our struggles in conjunction with others waging theirs, and the boundaries between us are indistinct.\n\nSeptember 19, 2015\n\u001c316\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDefeating weakness often means quieting the self. Only by quieting the self, by muting the sound of your own ego, can you see the world clearly. Only by quieting the self can you be open to the external sources of strengths you will need.\n\nSeptember 21, 2015\n\u001c316\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNo good life is possible unless it is organized around a vocation. If you try to use your work to serve yourself, you’ll find your ambitions and expectations will forever run ahead and you’ll never be satisfied. If you try to serve the community, you’ll always wonder if people appreciate you enough. But if you serve work that is intrinsically compelling and focus just on being excellent at that, you will wind up serving yourself and the community obliquely. A vocation is not found by looking within and finding your passion. It is found by looking\n\nSeptember 21, 2015\n\u001c317\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwithout and asking what life is asking of us. What problem is addressed by an activity you intrinsically enjoy?\n\nSeptember 21, 2015\n\u001c317\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c14. The best leader tries to lead along the grain of human nature rather than go against it. He realizes that he, like the people he leads, is likely to be sometimes selfish, narrow-minded, and self-deceiving. Therefore he prefers arrangements that are low and steady to those that are lofty and heroic. As long as the foundations of an institution are sound, he prefers change that is constant, gradual, and incremental to change that is radical and sudden. He understands that public life is a contest between partial truths and legitimate contesting interests. The goal of leadership is to find a just balance between competing values and competing goals.\n\nSeptember 21, 2015\n\u001c317\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c15. The person who successfully struggles against weakness and sin may or may not become rich and famous, but that person will become mature. Maturity is not based on talent or any of the mental or physical gifts that help you ace an IQ test or run fast or move gracefully. It is not comparative. It is earned not by being better than other people at something, but by being better than you used to be. It is earned by being dependable in times of testing, straight in times of temptation. Maturity does not glitter.\n\nSeptember 21, 2015\n\u001c318\n\u0011\n\u0011"}
}'


